import Link from 'next/link';

const Form = () => {
  return (
    <div>
      <p>This is the about page</p>

      <ul>
	<li>
	      <Link href="/">
		<a>Home</a>
	      </Link>
	</li>
	<li>
	      <Link href="/about">
		<a>About</a>
	      </Link>
	</li>
      </ul>
    </div>
  );
};

export default Form;
